-- Dumping data for table mal.anime: ~0 rows (approximately)
INSERT INTO `anime` (`id`, `title`, `synopsis`, `genre`, `image`, `added_by`) VALUES
	(10, 'Spirited Away', 'Spirited Away (千と千尋の神隠し, Sen to Chihiro no Kamikakushi) adalah film fantasi animasi Jepang 2001 yang ditulis dan disutradarai oleh Hayao Miyazaki, dianimasikan oleh Studio Ghibli untuk Tokuma Shoten, Nippon Television Network, Dentsu, Buena Vista Home Entertainment, Tohokushinsha Film, dan Mitsubishi.[7] Pengisi suara film ini antara lain: Rumi Hiiragi, Miyu Irino, Mari Natsuki, Takeshi Naito, Yasuko Sawaguchi, Tsunehiko Kamijō, Takehiko Ono, dan Bunta Sugawara.\r\n\r\nSpirited Away bercerita tentang Chihiro Ogino (Hiiragi), seorang gadis 10 tahun yang saat pindah ke lingkungan baru, memasuki dunia Kami (cerita rakyat roh Shinto Jepang).[8] Setelah orang tuanya diubah menjadi babi oleh penyihir Yubaba (Natsuki), Chihiro mengambil pekerjaan di pemandian Yubaba untuk menemukan cara membebaskan dirinya dan orang tuanya, dan kembali ke dunia manusia.\r\n\r\nAwalnya dirilis di Jepang pada 20 Juli 2001 oleh distributor Toho, film ini mendapat pengakuan universal,[9] mendapat US$395,8 juta di box office seluruh dunia.[a][10] Ini sering dianggap sebagai salah satu film terbaik abad ke-21 serta salah satu film animasi terbesar yang pernah dibuat.[11][12][13] Oleh karena itu, film ini menjadi film paling sukses dan berpenghasilan tertinggi dalam sejarah Jepang dengan total ¥31,68 miliar ($305 juta).[14] Ini memegang rekor selama 19 tahun sampai dilampaui oleh Demon Slayer: Kimetsu no Yaiba the Movie: Mugen Train pada tahun 2020.\r\n\r\nFilm ini memenangkan penghargaan Oscar pada tahun 2002 dalam kategori Film Animasi Terbaik dan menjadi anime pertama yang meraih penghargaan dalam kategori tersebut. Film ini juga memenangi Penghargaan Beruang Emas pada Pesta Film Internasional Berlin 2002 (bersama Bloody Sunday).', 'Supranatural, Fantasy', _binary , 7),
	(11, 'Violet Evergarden', 'Ceritanya berpusat di sekitar para Boneka Memori Otomatis (自動手記人形 Jidō Shuki Ningyō), yaitu orang-orang yang pada awalnya dipekerjakan oleh seorang ilmuwan bernama Dr. Orland demi membantu istrinya yang buta bernama Mollie untuk menulis novelnya, dan kemudian disewa oleh orang lain yang membutuhkan jasa mereka. Pada masa sekarang, istilah tersebut merujuk kepada pekerjaan menulis untuk orang lain. Cerita ini mengisahkan perjalanan Violet Evergarden yang mencoba untuk membaur di tengah kehidupan masyarakat setelah perang usai sekaligus mencari jati diri serta tujuan hidupnya setelah tidak lagi menjadi prajurit.', 'Drama', _binary , 8);
INSERT INTO `anime` (`id`, `title`, `synopsis`, `genre`, `image`, `added_by`) VALUES
	(12, 'One Punch Man', 'Di planet super benua yang tidak disebutkan namanya, monster aneh dan supervillains secara misterius muncul dan menyebabkan bencana. Untuk memerangi mereka, pahlawan dunia telah bangkit untuk melawan mereka. Saitama adalah salah satu pahlawan yang mampu mengatasi mereka. Ia berasal dari kota metropolitan Z dan dengan mudah mengalahkan monster dan penjahat dengan satu pukulan. Namun, ia bosan dengan kekuatan supernya karena musuhnya yang terlalu lemah baginya dan hanya menjadi sangat bersemangat saat melawan musuh kuat yang dapat menantangnya. Selama serial berlangsung, Saitama bertemu berbagai pahlawan super, supervillains, dan monster. Dia memiliki murid dalam bentuk siborg bernama Genos dan pada akhirnya mereka bergabung dengan Hero Association untuk mendapatkan pengakuan resmi. Selain itu, Saitama juga menghancurkan meteor yang masuk, mengalahkan penjahat bos seperti Deep Sea King. Ketika alien Dark Matter Thieves menyerang dan menghancurkan Kota A, Saitama mengalahkan pemimpin mereka Lord Boros dengan menggunakan pukulan serius.', 'Action', _binary , 7);

